  return (
    <React.Fragment>
      <tr>
        <th scope="row">ticket.id</th>
        <td>ticket.email</td>
        <td>Otto</td>
        <td>@mdo</td>
        <td>@mdo</td>
      </tr>
    </React.Fragment>
    
  );
}

export default App;
